import React from "react";

function SportsQuizApp() {
  return (
    <div className="posts">
      <div
        style={{
          height: "100vh",
          display: "flex",
          alignItems: "center",
          flexDirection: "column",
          justifyContent: "center",
        }}
      >
        <h1>Sports Quiz Mobile App</h1>
        <p>
          Currently in dev. Progress can be viewed by cloning the project repo
          from <a href="https://github.com/aa-fahim/SportsQuizApp">here</a>.
        </p>
      </div>
    </div>
  );
}

export default SportsQuizApp;
